import {useState, useEffect} from 'react'

import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import { FixedSizeList } from 'react-window';

export default function Models(props) {

    const [modelsList, setModelsList] = useState([]);
    const [currentModel, setCurrentModel] = useState();

    useEffect(() => fetch('/api/models')
        .then(respone => respone.json())
        .then(json => setModelsList(json)));

    const getBackgroundColor = status => (status === 'ready' ? 'green' : 'red');
    const getBorderColor = modelId => (modelId === currentModel ? 'black' : 'white');

    return (
        <div>
        <FixedSizeList height={400} width={300} itemSize={46} itemCount={modelsList.length}>
            {itemProps => {
                const { index, style } = itemProps;
                const model = modelsList[index];

                return (
                    <ListItem button style={style} key={index} onClick={() => setCurrentProperty(Object.keys(props.data)[index])}>
                        <ListItemText primary={`Upload time: ${model.uploadTime}\nStatus: ${model.status}`} />
                    </ListItem>
                );
            }}
        </FixedSizeList>

        {modelsList.map(item => (
            <li style={{listStyleType: 'none'}}>
                <div
                style={{
                    backgroundColor: getBackgroundColor(item.status),
                    padding: 20,
                    width: 250,
                    height: 50,
                    border: 20, 
                    borderRadius: 25,
                    borderColor: getBorderColor(item.modelId),
                    borderStyle: 'solid'
                }}
                onClick={() => {
                    if (item.status === 'ready') {
                        props.onModelSelect();
                        setCurrentModel(item.modelId);
                    }
                }}>
                    {item.uploadTime}
                        <br />
                    {item.status}
                </div>
                <br />
            </li>
        ))}
        </div>
    )
}
